	add("denial", "{\"term\":\"denial\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The negation in logic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A refusal to comply with a request\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An assertion of untruth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Refusal to believe a problem exist\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d3|page\u003d21|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/joris-luyendijk-banking-blog/2013/jun/19/banking-britain-beyond-control Our banks are out of passage\u003dSeeing the British establishment struggle with the financial sector is like watching an alcoholic\u0026amp;nbsp;[\u0026amp;hellip;].\u0026amp;nbsp; Until 2008 there was \u0027\u0027denial\u0027\u0027 over what finance had become. When a series of bank failures made this impossible, there was widespread anger, leading to the public humiliation of symbolic figures\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A defense mechanism involving a refusal to accept the truth of a phenomenon or prospect\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027 Feb. 11, \u0026quot;[http://www.washtimes.com/op-ed/20070211-102908-5463r.htm No facts, just emotion],\u0026quot; \u0027Washington Times\u0027 \u0026lt;small\u0026gt;(retrieved 11 June 2013)\u0026lt;/small\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"quot;\u0027\u0027Denial\u0027\u0027\u0026quot; came out of the therapyspeak prevalent in the middle of the 20th century, especially as it was applied to confronting the reality of mortality. It was popularized as the first stage of grief, and quickly expanded to include refusal to confront any bad news or disturbing ideas\", \"priority\":8}]}, \"synonyms\":{}}");

