	add("denotation", "{\"term\":\"denotation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From to denote (from Middle french (ca. 1400-1600) denoter, from Latin denotare \u0026quot;denote, mark out\u0026quot;, itself from de- \u0026quot;completely\u0026quot; + notare \u0026quot;to mark\u0026quot;) + -ation\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of denoting, or something (such as a symbol) that denote\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The primary, literal, or explicit meaning of a word, phrase, or symbol; that which a word denotes, as contrasted with its connotation; the aggregate or set of objects of which a word may be predicated\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027denotations\u0027\u0027 of the two expressions \u0026quot;the morning star\u0026quot; and \u0026quot;the evening star\u0026quot; are the same (i.e. both expressions denote the planet Venus), but their connotations are different\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The intension and extension of a wor\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Something signified or referred to; a particular meaning of a symbo\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The surface or literal meaning encoded to a signifier, and the definition most likely to appear in a dictionar\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Any mathematical object which describes the meanings of expressions from the languages, formalized in the theory of denotational semantic\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A first level of analysis: what the audience can visually see on a page. Denotation often refers to something literal, and avoids being a metaphor\", \"priority\":8}]}, \"synonyms\":{}}");

