	add("dentistry", "{\"term\":\"dentistry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|dentist|ry|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The field of medicine concerned with the study, diagnosis and treatment of conditions of the teeth and oral cavity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, P.B. Waite, \u0027The Lives of Dalhousie University\u0027, volume II: 1925-198\u0027, page 24\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He was born near Middleton in 1853, graduated from Mount Allison, and took his \u0027\u0027dentistry\u0027\u0027 degree at Philadelphia in 1878\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Operations performed on teeth and adjoining areas such as drilling, filling cavities and placing crowns and bridges.\u0026lt;!--These operations are not necessarily performed by dentists: DIY dentistry is still called dentistry.--\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Gregory J. Tarantola, \u0027Clinical Cases in Restorative and Reconstructive Dentistry\u0027 (ISBN 0470961783\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"This patient is an out-of-town physician who had to wait until retirement to complete his \u0027\u0027dentistry\u0027\u0027. He had holding pattern type \u0027\u0027dentistry\u0027\u0027 done to get him by\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A dental surgery, an operation on the teeth\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1908\u0027\u0027, in the report of the \u0027Second International Congress on School Hygiene\u0027, volume 2, page 516\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Dr. Landsberg, of Posen, states that when children\u0027s teeth are put in order by means of school \u0027\u0027dentistries\u0027\u0027, anaemia, one of the most frequent school diseases, will be greatly diminished\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Gene Witiak, \u0027True Confessions of a Veterinarian: An Unconditional Love Story\u0027, page 8\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"I speak now only of your pet\u0027s bad breath. \u0027\u0027Dentistries\u0027\u0027 will specifically improve the oral health of the pet as well as its overall health in the long term\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A place where dental operations are performed\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1867\u0027\u0027, in \u0027Macmillan\u0027s Magazine\u0027, volume 16, page 46\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"They are very fond of sweet things; and the ladies especially crowd the “candystores,”\u0026lt;!--sic--\u0026gt; which are not less numerous than the \u0027\u0027dentistries\u0027\u0027—with which business they are intimately connected\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, Edward Bernard Benjamin, \u0027The larger liberalism\u0027, page 172\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The author could dilate at great length on the possibilities in plant groceries, restaurants, and \u0027\u0027dentistries\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0027Former Yugoslav Republic of Macedonia: First Review\u0027 (ISBN 1452728488\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"As a first step, the law with be amended to prepare for the privatization of pharmacies and \u0027\u0027dentistries\u0027\u0027 by end-2003\", \"priority\":18}]}, \"synonyms\":{}}");

